import{_ as e,o as t,c as a,d as i}from"./app.5d78cf96.js";const T=JSON.parse('{"title":"19-表单脚本","description":"","frontmatter":{},"headers":[{"level":2,"title":"表单","slug":"表单","link":"#表单","children":[]}],"relativePath":"docs/javascript/books/javascript高级程序设计/19-表单脚本.md"}'),o={name:"docs/javascript/books/javascript高级程序设计/19-表单脚本.md"},l=i('<h1 id="_19-表单脚本" tabindex="-1">19-表单脚本 <a class="header-anchor" href="#_19-表单脚本" aria-hidden="true">#</a></h1><h2 id="表单" tabindex="-1">表单 <a class="header-anchor" href="#表单" aria-hidden="true">#</a></h2><p>Web 表单在 HTML 中以<code>&lt;form&gt;</code>元素表示，在 JavaScript 中则以 HTMLFormElement 类型表示</p><p>HTMLFormElement 也有自己的属性和方法。</p><ul><li>acceptCharset：服务器可以接收的字符集，等价于 HTML 的 accept-charset 属性。</li><li>action：请求的 URL，等价于 HTML 的 action 属性。</li><li>elements：表单中所有控件的 HTMLCollection。</li><li>enctype：请求的编码类型，等价于 HTML 的 enctype 属性。</li><li>length：表单中控件的数量。</li><li>method：HTTP 请求的方法类型，通常是&quot;get&quot;或&quot;post&quot;，等价于 HTML 的 method 属性。</li><li>name：表单的名字，等价于 HTML 的 name 属性。</li><li>reset()：把表单字段重置为各自的默认值。</li><li>submit()：提交表单。</li><li>target：用于发送请求和接收响应的窗口的名字，等价于 HTML 的 target 属性。</li></ul>',5),c=[l];function r(s,n,_,d,p,h){return t(),a("div",null,c)}const u=e(o,[["render",r]]);export{T as __pageData,u as default};
